        _startBlockNumber = block.number;    
    }

  

    function BlockScore(address user)public view returns(uint256){
        uint256 difference = block.number.sub(_mineInfo[user][1]);
        uint256 Product = balanceOf(user).mul(difference);
        uint256 accumulation =_mineInfo[user][2].add(Product);
        return accumulation;
    }


    function update(address user)public {
        uint256 difference = block.number.sub(_mineInfo[user][1]);
        uint256 start = MineStatus(_mineInfo[user][1]);
        uint256 end = block.number;
        
    }

    function updateBlockScore(address user)private{
        uint256 accumulation = BlockScore(user);       
        _mineInfo[user][2]= accumulation;       
        _mineInfo[user][1] = block.number; 
    }



    function MineStatus (uint256 _BlockNumber)public view returns (uint256){
        uint256 a = _DCFperBlock.mul(1e18);   
        uint256 b = _BlockNumber.mul(1e18).div(_startBlockNumber);
        uint256 c = a.div(b);
        return c;    
    }


